CREATE TABLE Students(student_id NUMBER, bio_data TEXT, student_details TEXT);

CREATE TABLE Transcripts(transcript_id NUMBER, student_id NUMBER, date_of_transcript TIME, transcript_details TEXT, Transcripts(student_id) REFERENCES Students(student_id));

CREATE TABLE Behaviour_Monitoring(behaviour_monitoring_id NUMBER, student_id NUMBER, behaviour_monitoring_details TEXT, Behaviour_Monitoring(student_id) REFERENCES Students(student_id));

CREATE TABLE Addresses(address_id NUMBER, address_details TEXT);

CREATE TABLE Ref_Event_Types(event_type_code TEXT, event_type_description TEXT);

CREATE TABLE Ref_Achievement_Type(achievement_type_code TEXT, achievement_type_description TEXT);

CREATE TABLE Ref_Address_Types(address_type_code TEXT, address_type_description TEXT);

CREATE TABLE Ref_Detention_Type(detention_type_code TEXT, detention_type_description TEXT);

CREATE TABLE Student_Events(event_id NUMBER, event_type_code TEXT, student_id NUMBER, event_date TIME, other_details TEXT, Student_Events(event_type_code) REFERENCES Ref_Event_Types(event_type_code), Student_Events(student_id) REFERENCES Students(student_id));

CREATE TABLE Teachers(teacher_id NUMBER, teacher_details TEXT);

CREATE TABLE Student_Loans(student_loan_id NUMBER, student_id NUMBER, date_of_loan TIME, amount_of_loan NUMBER, other_details TEXT, Student_Loans(student_id) REFERENCES Students(student_id));

CREATE TABLE Classes(class_id NUMBER, student_id NUMBER, teacher_id NUMBER, class_details TEXT, Classes(teacher_id) REFERENCES Teachers(teacher_id), Classes(student_id) REFERENCES Students(student_id));

CREATE TABLE Students_Addresses(student_address_id NUMBER, address_id NUMBER, address_type_code TEXT, student_id NUMBER, date_from TIME, date_to TIME, Students_Addresses(address_type_code) REFERENCES Ref_Address_Types(address_type_code), Students_Addresses(address_id) REFERENCES Addresses(address_id), Students_Addresses(student_id) REFERENCES Students(student_id));

CREATE TABLE Detention(detention_id NUMBER, detention_type_code TEXT, student_id NUMBER, datetime_detention_start TIME, datetime_detention_end TIME, detention_summary TEXT, other_details TEXT, Detention(detention_type_code) REFERENCES Ref_Detention_Type(detention_type_code), Detention(student_id) REFERENCES Students(student_id));

CREATE TABLE Achievements(achievement_id NUMBER, achievement_type_code TEXT, student_id NUMBER, date_achievement TIME, achievement_details TEXT, other_details TEXT, Achievements(achievement_type_code) REFERENCES Ref_Achievement_Type(achievement_type_code), Achievements(student_id) REFERENCES Students(student_id));

