CREATE TABLE Ref_Room_Types(room_type_code TEXT, room_type_description TEXT);

CREATE TABLE Ref_User_Categories(user_category_code TEXT, user_category_description TEXT);

CREATE TABLE Addresses(address_id NUMBER, line_1_number_building TEXT, line_2_number_street TEXT, line_3_area_locality TEXT, town_city TEXT, zip_postcode TEXT, county_state_province TEXT, country TEXT, other_address_details TEXT);

CREATE TABLE Features(feature_id NUMBER, feature_name TEXT, feature_description TEXT);

CREATE TABLE Users(user_id NUMBER, age_category_code TEXT, user_category_code TEXT, user_address_id NUMBER, is_buyer TEXT, is_seller TEXT, login_name TEXT, password TEXT, date_registered TIME, first_name TEXT, middle_name TEXT, last_name TEXT, other_user_details TEXT);

