CREATE TABLE Rooms(property_id NUMBER, room_number TEXT, room_type_code TEXT, room_size TEXT, other_room_details TEXT, Rooms(room_type_code) REFERENCES Ref_Room_Types(room_type_code), Rooms(property_id) REFERENCES Properties(property_id));

